export const DistinctDays = (cityForecastWeatherData) => {

    const timezone = cityForecastWeatherData.city.timezone

    console.log("timezone "+timezone)

 
    //Finding out all distinct dates in the five days forecast;
    const distinctDays = cityForecastWeatherData.list.map(forecastData => new Date(forecastData.dt + timezone).toLocaleDateString("en-US"))
    .filter((value, index, self) => self.indexOf(value) === index)
    return distinctDays
   }
